import React from 'react';
import { View, Text, TextInput, TouchableOpacity, ArrowView } from 'react-native';
import { styles } from '../Style/Style';
import Icon from 'react-native-vector-icons/FontAwesome';


export default function PhoneCodeRegistration() {
  return (
    <View style={styles.container}>
     
      <Text style={styles.header}>Code for phone</Text>

      <View style={styles.contentContainer}>
      <TouchableOpacity
        style={styles.backButton}

        onPress={() => {
          // обробка події для кнопки "назад" тут
        }}
      >
        <Icon name="chevron-left" style={styles.backButtonText} />
      </TouchableOpacity>
        <Text style={styles.label}>Write code</Text>
        <TextInput
          style={styles.input}
          placeholder="7788"
        />
        
        <Text style={styles.sentCodeAgainButtonText}>Sent code again</Text>
        <TouchableOpacity
          style={styles.signInButton}
        >
        <Text style={styles.signInLaber}>Finish  
        <Icon name="arrow-right" style={styles.arrowRight}/>
        <ArrowView
      from={{ x: 0, y: 0 }}
      to={{ x: 100, y: 100 }}
      // dash={[5, 10]} // optional: for define [dashLength, dashGap] 
      // color={color} // optional: color of arrow
      // curveDelta={curveDelta} // optional: for add more accuaracy
      // width={width} // optional: width of arrow lines
    />
        </Text>
        </TouchableOpacity>
      </View> 
    </View>
  );
}
